import React from 'react';
import './Login.scss';

const Login = () => {

    return (
        <div className="centered-content">
            <div className="modal-box">
                <h1 className="title">Login</h1>
                <button className="google-btn button">Signin with Google</button>
            </div>
        </div>
    )
}

export default Login
